get-started/add-core-data.html.body:
Add core datacore is the jsTree object contains basic
data and configurations of the tree. This is an example of core object:{
  data: [ // data can be an array or object.
    'Simple root node',
    {
      text: 'Root node 2',
      state: {
        opened: true,
        selected: true
      },
      children: [
        {
          text: 'Child 1'
        },
        'Child 2'
      ]
    }
  ]
}
Node FormatAs you know, a tree has one or many nodes, each node has one or many child nodes:// Alternative format of the node (id & parent are required)
{
  id: 'string' // required
  parent: 'string' // required
  text: 'string' // node text
  icon: 'string' // string for custom
  state: {
    opened: boolean  // is the node open
    disabled: boolean  // is the node disabled
    selected: boolean  // is the node selected
  },
  li_attr: { }  // attributes for the generated LI node
  a_attr: { }  // attributes for the generated A node
}
You can define a core object and use with core property:const CORE = {
  data: [
    'Simple root node',
    {
      text: 'Root node 2',
      state: {
        opened: true,
        selected: true
      },
      children: [
        {
          text: 'Child 1'
        },
        'Child 2'
      ]
    }
  ]
};

class ExampleApp extends React.Component {
  render() {
    return ();
  }
}
To make sure you can find what you need, go to jsTree API for more details.

get-started/add-onchanged-listener.html.body:
Add onChanged ListenerThis event will be triggered when a node is clicked:class ExampleApp extends React.Component {
  constructor(props) {
    super(props);

    this.state = { items: [] };

    this.handleOnChanged = this.handleOnChanged.bind(this);
  }

  handleOnChanged(changedItems) {
    this.setState({
      items: changedItems.map(item => item.text).join(', ')
    });
  }

  render() {
    return (


        Selected items: {this.state.items}

    );
  }
}

