ThemesIf user want to apply css for ReactTree, consider to include these files to your web app:node_modules/jstree/dist/themes/default/style.min.css

node_modules/jstree/dist/themes/default-dark/style.min.css

with additional options in core object, for instance with default-dark theme:const CORE = {
