      ]
    }
  ],
  themes: {
    name: 'default-dark'
  }
};
If you are using React ES6 with webpack,
you can add these themes easily by using css-loader:import 'node_modules/jstree/dist/themes/default/style.min.css';
import 'node_modules/jstree/dist/themes/default-dark/style.min.css';
You only need to import these themes one time.

